import { ChakraProvider, Box, Card } from "@chakra-ui/react";
import { Layout } from "../components/Layout";


const Home = () => {
    return(
     <ChakraProvider>
      <Layout>
        <Box padding="25px">
          <Card />
        </Box>
      </Layout>
    </ChakraProvider>
    )
}

export default Home;
